import React, { useState } from "react";
import "./Form.css"; // Custom CSS for styling

function FarmerForm() {
  const [formData, setFormData] = useState({
    name: "Amit Rai",
    address: "Casa Blanca Estate",
    postOffice: "Ormanjhi",
    tehsil: "Ruksa",
    state: "Jharkhand",
    landArea: "40",
    landId: "ChIJ8yfygP79DkRjDkn3pOJrtfE",
    mobile: "+91-787-555-2264",
    placeholder: ""
  });

  const [isEditable, setIsEditable] = useState(false); // Control for edit state

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleEdit = () => {
    setIsEditable(!isEditable); // Toggle edit mode on button click
  };

  const handleAdd = () => {
    alert("Add button clicked!");
    // Add logic here
  };

  const handleDelete = () => {
    alert("Delete button clicked!");
    // Delete logic here
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Form submitted!");
    // Submit logic here
  };

  return (
    <div className="form-container">
      <form onSubmit={handleSubmit}>
        <div className="form-row">
          <label>Name:</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            readOnly={!isEditable} // Make field readonly based on edit state
          />
        </div>

        <div className="form-row">
          <label>Address:</label>
          <input
            type="text"
            name="address"
            value={formData.address}
            onChange={handleChange}
            readOnly={!isEditable}
          />
        </div>

        <div className="form-row">
          <label>Post Office/Tehsil:</label>
          <input
            type="text"
            name="postOffice"
            value={formData.postOffice}
            onChange={handleChange}
            readOnly={!isEditable}
          />
          <input
            type="text"
            name="tehsil"
            value={formData.tehsil}
            onChange={handleChange}
            readOnly={!isEditable}
          />
        </div>

        <div className="form-row">
          <label>Land Area:</label>
          <input
            type="text"
            name="landArea"
            value={formData.landArea}
            onChange={handleChange}
            readOnly={!isEditable}
          />
        </div>

        <div className="form-row">
          <label>Place/Land ID:</label>
          <input
            type="text"
            name="landId"
            value={formData.landId}
            onChange={handleChange}
            readOnly={!isEditable}
          />
        </div>

        <div className="form-row">
          <label>Mobile No.:</label>
          <input
            type="text"
            name="mobile"
            value={formData.mobile}
            onChange={handleChange}
            readOnly={!isEditable}
          />
        </div>

        <div className="form-row">
          <label>Placeholder:</label>
          <input
            type="text"
            name="placeholder"
            value={formData.placeholder}
            onChange={handleChange}
            readOnly={!isEditable}
          />
        </div>

        <div className="button-row">
          <button type="button" onClick={handleAdd}>Add</button>
          <button type="button" onClick={handleEdit}>{isEditable ? "Save" : "Edit"}</button>
          <button type="button" onClick={handleDelete}>Delete</button>
          <button type="submit">Submit</button>
        </div>
      </form>
    </div>
  );
}

export default FarmerForm;
